import './App.css';
import { useWeatherApi } from './api/weather.js'

function App() {

  useWeatherApi()
    .then(data => {
      console.log(data.resolvedAddress)
      return data
    })

  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello world</h1>

      </header>
    </div>
  );
}

export default App;
